import axios from "axios";
import { url } from "inspector";
import { useEffect, useState } from "react";
import Pagination from "react-js-pagination";
import { IAnswer, IQuestion } from "./types";

import QuestionNote from "./QuestionNoteAnony";

export interface Props {
	questionList: IQuestion[];
	answerList: IAnswer[];
}

function QuestionNoteList(props: Props) {
	const answerList = props.answerList;
	return (
		<>
			<div className="question-notes-container">
				{props.questionList.map((question, idx) => (
					<QuestionNote key={idx} idx={idx} question={question} answer={answerList.find}/>
				))}
			</div>
		</>
	);
}

export default QuestionNoteList;
